import React from 'react';

const Results = ({ result }) => {
    return (
        <div style={{
            padding: '2rem',
            textAlign: 'center',
            backgroundColor: '#f9f9f9',
            borderRadius: '8px',
            boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
            margin: '2rem'
        }}>
            <h1>Upload Results</h1>
            <pre style={{
                textAlign: 'left',
                background: '#e8e8e8',
                padding: '1rem',
                borderRadius: '4px',
                overflow: 'auto',
                whiteSpace: 'pre-wrap',
                color: '#333'
            }}>
                {result ? result : "No results available."}
            </pre>
        </div>
    );
};

export default Results;
